const LastName = createContext();
const App=()=>{
  return(
    <> 
        <FirstName.Provider value={"sumit"}>
            <LastName.Provider value={"kamble"}>
              <ConA/>
            </LastName.Provider>
        </FirstName.Provider>
    </>
  )};
export default App;
export {FirstName,LastName};
